(def weight-blobs (map second exps))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;compare-phase-duration/weight-blobs</span>","value":"#'compare-phase-duration/weight-blobs"}
;; <=

;; @@
(def weights (map #(->> (a/get-hdf5-tensor store % "/weight") 
                       last
                       a/drop-half
                       (partition 9)
                       (mapv vec)
                       ) weight-blobs))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;compare-phase-duration/weights</span>","value":"#'compare-phase-duration/weights"}
;; <=

;; @@
(def bias-blobs (map #(% 2) exps))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;compare-phase-duration/bias-blobs</span>","value":"#'compare-phase-duration/bias-blobs"}
;; <=

;; @@
(def biases (map #(-> (a/get-hdf5-tensor store % "/weight") last vec) bias-blobs))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;compare-phase-duration/biases</span>","value":"#'compare-phase-duration/biases"}
;; <=

;; @@
(def phasedur-vs-probs
  (let [vc 9]
    (sort-by 
      first
      (doall (map (fn [[hc] w b] 
             [hc (map #(f/prob-visi (create-theoretical-rbm w 
                                                            (vec (take vc b)) 
                                                            (vec (drop vc b))) %)
                      bars)])
         exps weights biases)))))
